import ExpenseItem from "./ExpenseItem";

const ExpensesList = (props) => {
  let expense = <p>No expenses found</p>;

  if (props.items.length > 0)
    expense = props.items.map((expense) => {
      return (
        <ExpenseItem
          key={expense.id}
          title={expense.title}
          amount={expense.amount}
          date={expense.date}
        />
      );
    });
};

export default ExpensesList;
